import React from 'react'

class AsideFinances extends React.Component{
    render(){
        return(
        <div className='asideFinances'>
        <h1>Add expenses</h1>
            <form onSubmit={this.props.addToCharts}>
                <input type='expense' name='expense' placeholder='expense' />
                <input type='number' name='number' placeholder='amount' />
                <button type='button' name='asideFinancesButton'>Add</button>
            </form>
        </div>
        )
    }
}

export default AsideFinances
